import React from "react";

export default function HomePage() {
  return (
    <div className="min-h-screen bg-gradient-to-b from-purple-50 via-white to-white">
      {/* Navbar placeholder (if you have one) */}
      {/* <Navbar /> */}

      {/* Hero Section */}
      <section className="text-center py-24 px-6 max-w-4xl mx-auto">
        <h1 className="text-5xl md:text-6xl font-extrabold text-purple-800 mb-6">
          Welcome to <span className="text-purple-600">Kalaniketan</span>
        </h1>
        <p className="text-lg text-gray-700 mb-8">
          Protect what matters most with our comprehensive insurance plans tailored
          for your health, life, and vehicle.
        </p>
        <button className="bg-purple-700 text-white px-8 py-3 rounded-lg text-lg font-semibold hover:bg-purple-800 transition">
          Explore Plans
        </button>
      </section>

      {/* Features Section */}
      <section className="py-20 bg-white">
        <div className="max-w-6xl mx-auto grid md:grid-cols-3 gap-8 px-6">
          {[
            {
              title: "Health",
              desc: "Comprehensive health plans to safeguard you and your loved ones.",
            },
            {
              title: "Life",
              desc: "Secure your family’s future with our comprehensive life insurance plans.",
            },
            {
              title: "Vehicle",
              desc: "Reliable vehicle insurance for your car, bike, or commercial vehicle.",
            },
          ].map((feature, index) => (
            <div
              key={index}
              className="p-6 border rounded-lg shadow-sm hover:shadow-md transition"
            >
              <h2 className="text-2xl font-semibold mb-2 text-purple-800">
                {feature.title}
              </h2>
              <p className="text-gray-600">{feature.desc}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="text-center py-8 text-gray-600 text-sm">
        © 2025 Kalaniketan. All rights reserved.
        <div className="mt-4 space-x-4">
          <a href="#" className="hover:text-purple-700">Facebook</a>
          <a href="#" className="hover:text-purple-700">Instagram</a>
        </div>
      </footer>
    </div>
  );
}
